package app

import (
	"bytes"
	"compress/gzip"
	"encoding/base64"
	"io/ioutil"
)

const jquery = `
`

func JQuery() []byte {
	var err error

	var gzipcode []byte
	gzipcode, err = base64.StdEncoding.DecodeString(jquery)
	if err != nil {
		return nil
	}

	var r *gzip.Reader
	r, err = gzip.NewReader(bytes.NewReader(gzipcode))
	if err != nil {
		return nil
	}
	defer r.Close()

	var j []byte
	j, err = ioutil.ReadAll(r)
	if err != nil {
		return nil
	}
	return j
}
